DECLARE @TEMP TABLE(SSN VARCHAR(9), CLUID VARCHAR(19), IBR_START_DATE DATE, IBR_MONTHS INT, PRIOR_SERVICER VARCHAR(20))

SELECT DISTINCT
	T.*,
	SUM(ISNULL(LN15.LA_DSB,0.00) - ISNULL(LN15.LA_DSB_CAN,0.00)) AS OriginalLoanAmount,
	OLbalance.Principal AS PrincipalAtTransfer,
	OLbalance.Interest AS InterestAtTransfer,
	LN10.LD_LON_GTR AS GuaranteeDate,
	LN10.IC_LON_PGM AS LoanType
FROM 
	@TEMP T
	INNER JOIN UDW..LN10_LON LN10
		ON LN10.BF_SSN = T.SSN
		AND LN10.LF_LON_ALT + RIGHT('00' + CAST(LN10.LN_LON_ALT_SEQ AS VARCHAR(2)),2) = T.CLUID
	INNER JOIN UDW..LN15_DSB LN15
		ON LN15.BF_SSN = LN10.BF_SSN
		AND LN15.LN_SEQ = LN10.LN_SEQ
		AND LN15.LC_STA_LON15 = '1'
		AND LN15.LC_DSB_TYP = '2'
	INNER JOIN
	(
		SELECT
			DC01.AF_APL_ID,
			DC01.AF_APL_ID_SFX,
			SUM(ISNULL(DC02.LA_CLM_BAL,0.00) - ISNULL(DC02.LA_CLM_INT_ACR,0.00) - ISNULL(DC02.LA_CLM_PRJ_COL_CST,0.00)) AS Principal,
			SUM(ISNULL(DC02.LA_CLM_INT_ACR,0.00)) AS Interest
		FROM
			ODW..DC01_LON_CLM_INF DC01
			INNER JOIN
			(
				SELECT
					DC01M.AF_APL_ID,
					DC01M.AF_APL_ID_SFX,
					MAX(DC01M.LF_CRT_DTS_DC10) AS LF_CRT_DTS_DC10
				FROM
					ODW..DC01_LON_CLM_INF DC01M
				GROUP BY
					DC01M.AF_APL_ID,
					DC01M.AF_APL_ID_SFX
			)DC01Max
				ON DC01Max.AF_APL_ID = DC01.AF_APL_ID
				AND DC01Max.AF_APL_ID_SFX = DC01.AF_APL_ID_SFX
				AND DC01Max.LF_CRT_DTS_DC10 = DC01.LF_CRT_DTS_DC10
			INNER JOIN ODW..DC02_BAL_INT DC02
				ON DC02.AF_APL_ID = DC01Max.AF_APL_ID
				AND DC02.AF_APL_ID_SFX = DC01Max.AF_APL_ID_SFX
				AND DC02.LF_CRT_DTS_DC10 = DC01Max.LF_CRT_DTS_DC10
		GROUP BY
			DC01.AF_APL_ID,
			DC01.AF_APL_ID_SFX
	) OLbalance
		ON OLbalance.AF_APL_ID + AF_APL_ID_SFX = T.CLUID
GROUP BY
	T.SSN,
	T.CLUID,
	T.IBR_MONTHS,
	T.IBR_START_DATE,
	T.PRIOR_SERVICER,
	OLbalance.Principal,
	OLbalance.Interest,
	LN10.LD_LON_GTR,
	LN10.IC_LON_PGM
ORDER BY
	T.SSN,
	T.CLUID
